"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[2017],{2017:a=>{a.exports=JSON.parse('{"lessonId":"B1_U66","title":"\u0423\u0440\u043e\u043a 66: Pret\xe9rito pluscuamperfecto","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0424\u043e\u0440\u043c\u044b Pret\xe9rito pluscuamperfecto","content":[{"text":"<strong>Hab\xeda cerrado</strong> \u0438 <strong>se hab\xeda afeitado</strong> \u2014 \u044d\u0442\u043e \u0444\u043e\u0440\u043c\u044b \u0434\u0430\u0432\u043d\u043e\u043f\u0440\u043e\u0448\u0435\u0434\u0448\u0435\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 (pret\xe9rito pluscuamperfecto)."},{"text":"<strong>`pret\xe9rito imperfecto de haber` + `participio` (\u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435)</strong>"},{"table":{"headers":[],"rows":[["(yo) hab\xeda","(nosotros, -as) hab\xedamos"],["(t\xfa) hab\xedas","trabajado","(vosotros, -as) hab\xedais"],["(\xe9l, ella, usted) hab\xeda","comido, vivido","(ellos, -as, ustedes) hab\xedan"]]}}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 Pret\xe9rito pluscuamperfecto","content":[{"text":"<strong>1. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u043e\u0441\u044c \u0434\u043e \u0434\u0440\u0443\u0433\u043e\u0433\u043e \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f.</strong><br><i>(1) el banco cerr\xf3 \u2192 (2) llegu\xe9 al banco<br>Cuando <strong>llegu\xe9</strong> al banco (2), ya <strong>hab\xeda cerrado</strong> (1).<br><br>(1) el tren se fue \u2192 (2) llegamos a la estaci\xf3n<br>Cuando <strong>llegamos</strong> a la estaci\xf3n (2), el tren se <strong>hab\xeda ido</strong> ya (1).</i>"},{"text":"<strong>2. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u043e\u0431\u044a\u044f\u0441\u043d\u0435\u043d\u0438\u044f \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u0438\u043b\u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u0434\u0440\u0443\u0433\u043e\u0433\u043e \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f.</strong><br><i>\u2013\xbfPor qu\xe9 suspendiste? \u2013No <strong>hab\xeda estudiado</strong> nada.</i>"},{"text":"<strong>3. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f, \u0447\u0442\u043e\u0431\u044b \u0441\u043a\u0430\u0437\u0430\u0442\u044c \u0438\u043b\u0438 \u0441\u043f\u0440\u043e\u0441\u0438\u0442\u044c, \u0431\u044b\u043b\u043e \u043b\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043e \u0434\u043e \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0432 \u043f\u0440\u043e\u0448\u043b\u043e\u043c.</strong><br><i>Cuando <strong>conoc\xed</strong> a Teresa, ya <strong>hab\xeda tenido</strong> el ni\xf1o.<br>Cuando Helga <strong>vino</strong> a Espa\xf1a, \xbf<strong>hab\xeda estudiado</strong> ya algo de espa\xf1ol?</i>"},{"text":"<strong>4. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 `todav\xeda no / no... todav\xeda` \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0435\u0449\u0435 \u043d\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0432 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e.</strong><br><i>Cuando Mariano y Concha <strong>se conocieron</strong>, Concha todav\xeda no <strong>hab\xeda acabado</strong> la carrera.<br>Cuando <strong>llam\xe9</strong> a casa de Antonio, no se <strong>hab\xeda levantado</strong> todav\xeda.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 66.1: \u0421\u043e\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u043e\u0434\u043d\u043e \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0438\u0437 \u0434\u0432\u0443\u0445","tasks":[{"id":"u66_1_1","sentence":"1. La reuni\xf3n acab\xf3. Llegu\xe9 a la oficina. \u2192 Cuando llegu\xe9 a la oficina, la reuni\xf3n ___.","answer":"hab\xeda acabado"},{"id":"u66_1_2","sentence":"2. El avi\xf3n se fue. Llegamos al aeropuerto. \u2192 ___.","answer":"Cuando llegamos al aeropuerto, el avi\xf3n ya se hab\xeda ido"},{"id":"u66_1_3","sentence":"3. Cerraron las tiendas. Aurora quiso comprar comida. \u2192 ___.","answer":"Cuando Aurora quiso comprar comida, ya hab\xedan cerrado las tiendas"},{"id":"u66_1_4","sentence":"4. Cen\xe9. Sonia me llam\xf3. \u2192 ___.","answer":"Cuando Sonia me llam\xf3, yo ya hab\xeda cenado"},{"id":"u66_1_5","sentence":"5. Hubo un accidente. Nos pararon en la carretera. \u2192 ___.","answer":"Nos pararon en la carretera porque hab\xeda habido un accidente"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 66.2: \u0421\u043e\u0435\u0434\u0438\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 \u0438\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f\u043c\u0438","content":[{"text":"<strong>\u041f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f:</strong> a. No pudieron entrar en casa. b. Aprob\xf3 todo. c. Tuvieron que volver a casa. d. No pude comprar nada. e. No pudimos comer en casa. f. Te desmayaste. g. No pude hablar con \xe9l. h. No la reconocimos. i. Lleg\xf3 tarde."}],"tasks":[{"id":"u66_2_1","sentence":"1. No pude comprar nada porque ___.","answer":"me hab\xeda dejado la tarjeta de cr\xe9dito"},{"id":"u66_2_2","sentence":"2. ___ porque se hab\xedan dejado las luces encendidas.","answer":"Tuvieron que volver a casa"},{"id":"u66_2_3","sentence":"3. ___ porque se hab\xedan dejado las llaves dentro.","answer":"No pudieron entrar en casa"},{"id":"u66_2_4","sentence":"4. ___ porque no hab\xedamos reservado mesa.","answer":"No pudimos comer en casa"},{"id":"u66_2_5","sentence":"5. ___ porque hab\xeda estudiado mucho.","answer":"Aprob\xf3 todo"},{"id":"u66_2_6","sentence":"6. ___ porque hab\xedas tenido un peque\xf1o accidente.","answer":"Te desmayaste"},{"id":"u66_2_7","sentence":"7. ___ porque ya se hab\xeda ido.","answer":"No pude hablar con \xe9l"},{"id":"u66_2_8","sentence":"8. ___ porque se hab\xeda cortado el pelo.","answer":"No la reconocimos"},{"id":"u66_2_9","sentence":"9. ___ porque no hab\xeda comprado comida.","answer":"Lleg\xf3 tarde"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 66.3","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 66.3 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]}]}')}}]);